import React from "react"
import {Avatar,Card} from "antd"
import avat from "../static/img/avator.jpg"
import { UserOutlined } from '@ant-design/icons';
export default function About(){
    return(
        <div id="about">
             <Card
            title="关于我"
            type="inner"
            headStyle={{
                textAlign:"center"
            }}
            bodyStyle={{
                textAlign:"center",
                paddingTop:"50px"
            }}
        >
                <Avatar
                    icon={UserOutlined}
                    src={avat}
                    size={160}  
                >
                </Avatar>
            </Card>
        </div>
    )
}
